import { useSelector} from "react-redux"



const Moviedetails = () => {

    const movieLength = useSelector((state)=>{return state.movies.movieCount})    

    return (
        <div className='movie'>
            Moviedetails
            {movieLength}
        </div>
    );
};

export default Moviedetails;
